import React from 'react';
import { motion } from 'framer-motion';
import './LandingPage.css';

// Import background images (you'll need to add these to your project)
// For demo purposes, I'll use gradient backgrounds that represent data science concepts

const LandingPage = () => {
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: { staggerChildren: 0.2 },
    },
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: { y: 0, opacity: 1, transition: { duration: 0.6 } },
  };

  return (
    <div className="landing-page">
      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-background">
          {/* Background Layers */}
          <div className="bg-layer bg-layer-1"></div>
          <div className="bg-layer bg-layer-2"></div>
          <div className="bg-layer bg-layer-3"></div>
          
          {/* Animated Elements */}
          <div className="animated-elements">
            <motion.div 
              className="floating-card card-1"
              animate={{ 
                y: [0, -20, 0],
                rotate: [0, 2, 0]
              }}
              transition={{ 
                duration: 8, 
                repeat: Infinity,
                ease: "easeInOut"
              }}
            >
              <div className="card-content">
                <span className="card-icon">üìä</span>
                <span>Data Visualization</span>
              </div>
            </motion.div>
            
            <motion.div 
              className="floating-card card-2"
              animate={{ 
                y: [0, 15, 0],
                rotate: [0, -3, 0]
              }}
              transition={{ 
                duration: 7, 
                repeat: Infinity,
                ease: "easeInOut",
                delay: 1
              }}
            >
              <div className="card-content">
                <span className="card-icon">ü§ñ</span>
                <span>AI & ML</span>
              </div>
            </motion.div>
            
            <motion.div 
              className="floating-card card-3"
              animate={{ 
                y: [0, -15, 0],
                rotate: [0, 1, 0]
              }}
              transition={{ 
                duration: 9, 
                repeat: Infinity,
                ease: "easeInOut",
                delay: 2
              }}
            >
              <div className="card-content">
                <span className="card-icon">üìà</span>
                <span>Analytics</span>
              </div>
            </motion.div>
          </div>
        </div>
        
        <div className="hero-overlay"></div>
        
        <div className="hero-content-container">
          <motion.div 
            className="hero-content" 
            initial="hidden" 
            animate="visible" 
            variants={containerVariants}
          >
            <motion.div variants={itemVariants} className="hero-badge">
              <span>üöÄ Trending</span> Join 100K+ Learners
            </motion.div>
            
            <motion.h1 variants={itemVariants} className="hero-title">
              Master <span className="gradient-text">Data Science</span>
            </motion.h1>
            
            <motion.h2 variants={itemVariants} className="hero-subtitle">
              Transform Your Future Today
            </motion.h2>
            
            <motion.p variants={itemVariants} className="hero-description">
              Learn Python, Machine Learning, AI, and Data Analytics through hands-on projects.
              Build real-world skills that employers demand in today's data-driven world.
            </motion.p>
            
            <motion.div variants={itemVariants} className="hero-cta">
              <button className="primary-button">
                <span className="button-icon">üéØ</span>
                Start Learning Free
              </button>
              <button className="secondary-button">
                <span className="button-icon">üì∫</span>
                Watch Learning Path
              </button>
            </motion.div>
            
            <motion.div variants={itemVariants} className="hero-features">
              <div className="feature">
                <span className="check">‚úÖ</span>
                <span>No credit card required</span>
              </div>
              <div className="feature">
                <span className="check">‚úÖ</span>
                <span>7-day free trial</span>
              </div>
              <div className="feature">
                <span className="check">‚úÖ</span>
                <span>Cancel anytime</span>
              </div>
            </motion.div>
          </motion.div>
          
          <div className="hero-visual">
            <div className="stats-display">
              <div className="stats-grid">
                <div className="stat-item">
                  <div className="stat-value">100K+</div>
                  <div className="stat-label">Active Learners</div>
                </div>
                <div className="stat-item">
                  <div className="stat-value">500+</div>
                  <div className="stat-label">Projects</div>
                </div>
                <div className="stat-item">
                  <div className="stat-value">95%</div>
                  <div className="stat-label">Success Rate</div>
                </div>
                <div className="stat-item">
                  <div className="stat-value">24/7</div>
                  <div className="stat-label">Support</div>
                </div>
              </div>
              
              <div className="achievement-badge">
                <div className="badge-icon">üèÜ</div>
                <div className="badge-content">
                  <div className="badge-title">Top Rated Platform</div>
                  <div className="badge-subtitle">4.9/5 from 2,500+ reviews</div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Features Section */}
      <section className="features-section">
        <div className="section-container">
          <motion.h2 
            className="section-title"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            Why Choose Our Platform
          </motion.h2>
          
          <motion.p 
            className="section-subtitle"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.1 }}
            viewport={{ once: true }}
          >
            We provide everything you need to launch your data science career
          </motion.p>
          
          <div className="features-grid">
            <motion.div 
              className="feature-card"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: 0.2 }}
              viewport={{ once: true }}
            >
              <div className="feature-icon">üìä</div>
              <h3>Hands-on Projects</h3>
              <p>Apply your skills with real-world projects and build a portfolio that impresses employers.</p>
            </motion.div>
            
            <motion.div 
              className="feature-card"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: 0.3 }}
              viewport={{ once: true }}
            >
              <div className="feature-icon">üß†</div>
              <h3>Expert Instructors</h3>
              <p>Learn from industry professionals with years of experience in data science and AI.</p>
            </motion.div>
            
            <motion.div 
              className="feature-card"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: 0.4 }}
              viewport={{ once: true }}
            >
              <div className="feature-icon">üöÄ</div>
              <h3>Career Support</h3>
              <p>Get help with resume building, interview preparation, and job placement assistance.</p>
            </motion.div>
            
            <motion.div 
              className="feature-card"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: 0.5 }}
              viewport={{ once: true }}
            >
              <div className="feature-icon">üì±</div>
              <h3>Learn Anywhere</h3>
              <p>Access courses on any device and learn at your own pace with our mobile-friendly platform.</p>
            </motion.div>
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="cta-section">
        <div className="cta-background"></div>
        <div className="section-container">
          <motion.h2
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            Ready to Start Your Data Science Journey?
          </motion.h2>
          <motion.p
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.1 }}
            viewport={{ once: true }}
          >
            Join thousands of students who have transformed their careers with our platform.
          </motion.p>
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.2 }}
            viewport={{ once: true }}
          >
            <button className="primary-button large">Get Started Now</button>
          </motion.div>
        </div>
      </section>
    </div>
  );
};

export default LandingPage;
